import React, { useState, useEffect } from 'react';

function App() {
  const [items, setItems] = useState([]);
  const [inputItem, setInputItem] = useState('');

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch('http://localhost:5000/suggestion', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
      });
      const data = await response.json();
      setItems(data.items);
    } catch (error) {
      console.error(error);
    }
  };

  const handleInputChange = (event) => {
    setInputItem(event.target.value);
  };

  const handleInsertItem = async () => {
    try {
      const response = await fetch('http://localhost:5000/insert', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ item: inputItem }),
      });
      const data = await response.json();
      console.log(data); // Log the response data
      setInputItem('');
      fetchData(); // Fetch updated data after insertion
    } catch (error) {
      console.error(error);
    }
  };


  return (
    <div>
      <h1>Recent Search History:</h1>
      <ul>
        {items.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>

      <div>
        <input type="text" value={inputItem} onChange={handleInputChange} />
        <button onClick={handleInsertItem}>Insert</button>
      </div>
    </div>
  );
}

export default App;
